$ser_content = 'a:2:{s:7:"CONTENT";s:0:"";s:4:"VARS";a:3:{i:23395;a:24:{s:2:"ID";s:5:"23395";s:11:"ACTIVE_FROM";s:20:"26 апреля 2013";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:24:"Настя и Павел";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"23395:21";s:20:"PROPERTY_EMAIL_VALUE";s:12:"mcrm@mcrm.ru";s:23:"PROPERTY_EMAIL_VALUE_ID";s:8:"23395:22";s:25:"PROPERTY_SPECIALIST_VALUE";s:0:"";s:28:"PROPERTY_SPECIALIST_VALUE_ID";s:8:"23395:23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:339:"Здравствуйте Ольга Игоревна! Хотелось бы выразить большую благодарность за обретенное нами счастье, благодаря Вам и всему вашему центру у нас появилась на свет 13.04.2013 г. Дочь Елизавета.	";s:4:"TYPE";s:4:"HTML";}s:25:"PROPERTY_MESSAGE_VALUE_ID";s:8:"23395:24";s:19:"PROPERTY_FILE_VALUE";a:0:{}s:17:"PROPERTY_PD_VALUE";s:1:"1";s:20:"PROPERTY_PD_VALUE_ID";s:8:"23395:26";s:24:"PROPERTY_LAST_NAME_VALUE";N;s:27:"PROPERTY_LAST_NAME_VALUE_ID";s:9:"23395:115";s:27:"PROPERTY_IS_MODERATED_VALUE";s:1:"1";s:30:"PROPERTY_IS_MODERATED_VALUE_ID";s:9:"23395:139";s:25:"PROPERTY_SHOW_ON_EN_VALUE";N;s:28:"PROPERTY_SHOW_ON_EN_VALUE_ID";s:9:"23395:612";s:25:"PROPERTY_FILE_DESCRIPTION";a:0:{}s:31:"PROPERTY_FILE_PROPERTY_VALUE_ID";a:0:{}s:10:"specialist";b:0;s:4:"file";a:0:{}}i:23483;a:24:{s:2:"ID";s:5:"23483";s:11:"ACTIVE_FROM";s:16:"30 июля 2014";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:10:"Елена";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"23483:21";s:20:"PROPERTY_EMAIL_VALUE";s:21:"accord-2013@yandex.ru";s:23:"PROPERTY_EMAIL_VALUE_ID";s:8:"23483:22";s:25:"PROPERTY_SPECIALIST_VALUE";s:0:"";s:28:"PROPERTY_SPECIALIST_VALUE_ID";s:8:"23483:23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:2242:"Ольга Евгеньевна!!! Спасибо Вам большое! После Вашего профессионализма, знаний, опыта, неравнодушия очень трудно найти в нашем  сибирском городе специалиста, который бы, так же как Вы - грамотно, быстро и профессионально назначил лечение или провел консультации. Профессиональная планка врачей МЦРМ высока, а наши местные специалисты-врачи, увы, сильно отстают и намного уступают Вам в профессионализме и знаниях. И это просто счастье для нас, пациентов, что есть такие  Врачи от Бога, как Вы! Спасибо Вам безграничное за то, что частицу своей души и сердца Вы ежедневно дарите нам! За мгновенные ответы на все наши вопросы! За постоянную и неустанную помощь! За вдохновляющие слова! За доброту и поддержку! Вчера, когда я получила Ваше письмо, у меня опять &quot;выросли крылья&quot;! Спасибо Вам преогромное за очередную консультацию - целительный бальзам! С Вами так легко лечиться и идти к заветной цели! А главное, надежно и спокойно! Желаю Вам здоровья и благополучия! Исполнения Ваших мечтаний! Пусть все то, что Вы так щедро дарите нам, возвращается к Вам с удвоенной, утроенной силой! И пусть Ваша профессиональная дорога будет интересной, увлекательной и конечно же, очень счастливой! С большой благодарностью к Вам, Ваша пациентка.";s:4:"TYPE";s:4:"HTML";}s:25:"PROPERTY_MESSAGE_VALUE_ID";s:8:"23483:24";s:19:"PROPERTY_FILE_VALUE";a:0:{}s:17:"PROPERTY_PD_VALUE";s:1:"1";s:20:"PROPERTY_PD_VALUE_ID";s:8:"23483:26";s:24:"PROPERTY_LAST_NAME_VALUE";N;s:27:"PROPERTY_LAST_NAME_VALUE_ID";s:9:"23483:115";s:27:"PROPERTY_IS_MODERATED_VALUE";s:1:"1";s:30:"PROPERTY_IS_MODERATED_VALUE_ID";s:9:"23483:139";s:25:"PROPERTY_SHOW_ON_EN_VALUE";N;s:28:"PROPERTY_SHOW_ON_EN_VALUE_ID";s:9:"23483:612";s:25:"PROPERTY_FILE_DESCRIPTION";a:0:{}s:31:"PROPERTY_FILE_PROPERTY_VALUE_ID";a:0:{}s:10:"specialist";b:0;s:4:"file";a:0:{}}i:24501;a:24:{s:2:"ID";s:5:"24501";s:11:"ACTIVE_FROM";s:19:"6 ноября 2019";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:18:"Екатерина";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"24501:21";s:20:"PROPERTY_EMAIL_VALUE";s:20:"Demetra705@yandex.ru";s:23:"PROPERTY_EMAIL_VALUE_ID";s:8:"24501:22";s:25:"PROPERTY_SPECIALIST_VALUE";i:19;s:28:"PROPERTY_SPECIALIST_VALUE_ID";s:8:"24501:23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:391:"Добрый день! Хотим выразить огромную благодарнось доктору Меньш